This is a fun little poem I wrote many years ago when my youngest daughter (now 9) was just starting to walk. The title is derived from the fact that she has inherited my brown eyes (and is startlingly similar to me in many respects!) whereas her sister has her mother's blue eyes and takes much more after her. They're both growing up to be smart, inquisitive, emotionally intelligent people and I'm beyond proud to be their Dad. 
